import Table from 'react-bootstrap/Table';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';

function View_Users() {
  return (
    <Container>
    <Table responsive striped bordered hover variant="dark" className='mt-5'>
      <thead>
        <tr>
          <th>#</th>
          <th>Name</th>
           <th>Username</th>
          <th>Options</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Markssssssssssssssssssssssss</td>
          <td>Ottossssssssssssssssssssss</td>
         
          <td>

         
          <Button variant="outline-primary"><i class="fa-solid fa-pen-to-square mt-2 ms"></i></Button>{' '}

          <Button variant="outline-danger">Block</Button>{' '}
          <Button variant="outline-success">Unblock</Button>{' '}
          <Button variant="outline-danger"><i class="fa-solid fa-trash"></i></Button>{' '}


          </td>
        </tr>
       
      </tbody>
    </Table>
    </Container>
  );
}

export default View_Users;



